package basic;

public class Swap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
      int num1,num2,temp;
      num1=10;
      num2=20;
      System.out.println("Before Swapping: "+num1+num2);
      temp=num1;
      num1=num2;
      num2=temp;
      System.out.println("After Swapping: "+num1+num2);
	}

}
